    const [data,setData]=useState([]);
    useEffect(()=>{
        getProfiles().then((res)=>{
setData(res);
console.log(res);
        });
    },[])
    return (
        <div>
            {data.map((item)=>{
                <div>{item.name}</div>
            })}
        </div>
    );
};

export default Main;
